import React from "react";
import PostItem from "./PostItem";

const Posts = ({posts}) => {
    console.log("posts", posts);
    return (
        <div>
            {posts.map((item) => {
                return <PostItem key={posts._id} posts={item} />
            })}
        </div>
    )
};

export default Posts;
